import base64
import zlib

# Replace this with the actual byte string you have
encoded_payload = b''


def add_padding(data):
    # Tambahkan padding jika perlu
    missing_padding = len(data) % 4
    if missing_padding:
        data += b'=' * (4 - missing_padding)
    return data

def decrypt(data):
    # Proses dekripsi
    reversed_data = data[::-1]
    reversed_data = add_padding(reversed_data)
    decoded_data = base64.b64decode(reversed_data)
    return zlib.decompress(decoded_data)

def decrypt_multiple_times(encoded, times):
    current_payload = encoded
    
    for i in range(times):
        try:
            current_payload = decrypt(current_payload)
            if (i + 1) % 1000 == 0:  # Cetak setiap 1000 iterasi
                print(f"Iteration {i + 1}: {current_payload.decode('utf-8', errors='ignore')}")
        except Exception as e:
            print(f"Error during decryption at iteration {i + 1}: {e}")
            break

    return current_payload

# Dekripsi sampai 100 kali pada encoded_payload
final_output = decrypt_multiple_times(encoded_payload, 100)

# Output hasil akhir
if final_output:
    print("Final output after 100 iterations:")
    print(final_output.decode('utf-8', errors='ignore'))
else:
    print("No valid final output.")